import React, { useState } from 'react';
import spdf from "simple-react-pdf";
import styles from "assets/jss/material-kit-react/views/componentsSections/tabsStyle.js";
import { makeStyles } from "@material-ui/core/styles";
import { VerticalTimeline, VerticalTimelineElement } from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';
import {Chip, Avatar} from '@material-ui/core';

const useStyles = makeStyles(styles);

export default function ExperienceSection() {
  const classes = useStyles();
  return (
    <div style={{backgroundColor:"#EEEEEE"}} className={classes.section}>
      <div className={classes.container}>
        <div id="navigation-pills">
          <div className={classes.title}>
            <h1 >Experience</h1>
            <hr style={{ borderTop: "1px solid #bbb", borderRadius: "5px" }} />
          </div>
          <VerticalTimeline>
            <VerticalTimelineElement
              className="vertical-timeline-element--work"
              date="May 2020 - Present"
              iconStyle={{ background: '#003366', color: '#fff' }}
              //icon={}
              style={{fontSize:"20px"}}
            >
              <div className="row">
              <Chip color="#87CEEB" style={{fontSize:"16px"}} label="React" size="small" avatar={<Avatar src={require("../../../assets/img/icons/react.png")} />} />
              <div style={{paddingLeft:"5px"}}>
              <Chip color="#87CEEB" style={{fontSize:"16px", paddingLeft:"10px"}} label="React" size="small" avatar={<Avatar src={require("../../../assets/img/icons/mongo.png")} />} />
              </div>
              </div>
              <h3 style={{paddingTop:"20px", fontSize:"20px"}} className="vertical-timeline-element-title">Software Development Engineer Intern</h3>
              <h2 style={{fontSize:"18px"}} className="vertical-timeline-element-subtitle">The 808 Wave</h2>
            </VerticalTimelineElement>
            <VerticalTimelineElement
              className="vertical-timeline-element--work"
              date="2010 - 2011"
              iconStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
              //icon={}
            >
              <h3 className="vertical-timeline-element-title">Art Director</h3>
              <h4 className="vertical-timeline-element-subtitle">San Francisco, CA</h4>
              <p>
                Creative Direction, User Experience, Visual Design, SEO, Online Marketing
    </p>
            </VerticalTimelineElement>
            <VerticalTimelineElement
              className="vertical-timeline-element--work"
              date="2008 - 2010"
              iconStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
              //icon={}
            >
              <h3 className="vertical-timeline-element-title">Web Designer</h3>
              <h4 className="vertical-timeline-element-subtitle">Los Angeles, CA</h4>
              <p>
                User Experience, Visual Design
    </p>
            </VerticalTimelineElement>
            <VerticalTimelineElement
              className="vertical-timeline-element--work"
              date="2006 - 2008"
              iconStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
              //icon={}
            >
              <h3 className="vertical-timeline-element-title">Web Designer</h3>
              <h4 className="vertical-timeline-element-subtitle">San Francisco, CA</h4>
              <p>
                User Experience, Visual Design
    </p>
            </VerticalTimelineElement>
            <VerticalTimelineElement
              className="vertical-timeline-element--education"
              date="April 2013"
              iconStyle={{ background: 'rgb(233, 30, 99)', color: '#fff' }}
              //icon={}
            >
              <h3 className="vertical-timeline-element-title">Content Marketing for Web, Mobile and Social Media</h3>
              <h4 className="vertical-timeline-element-subtitle">Online Course</h4>
              <p>
                Strategy, Social Media
    </p>
            </VerticalTimelineElement>
            <VerticalTimelineElement
              className="vertical-timeline-element--education"
              date="November 2012"
              iconStyle={{ background: 'rgb(233, 30, 99)', color: '#fff' }}
              //icon={}
            >
              <h3 className="vertical-timeline-element-title">Agile Development Scrum Master</h3>
              <h4 className="vertical-timeline-element-subtitle">Certification</h4>
              <p>
                Creative Direction, User Experience, Visual Design
    </p>
            </VerticalTimelineElement>
            <VerticalTimelineElement
              className="vertical-timeline-element--education"
              date="2002 - 2006"
              iconStyle={{ background: 'rgb(233, 30, 99)', color: '#fff' }}
              //icon={}
            >
              <h3 className="vertical-timeline-element-title">Bachelor of Science in Interactive Digital Media Visual Imaging</h3>
              <h4 className="vertical-timeline-element-subtitle">Bachelor Degree</h4>
              <p>
                Creative Direction, Visual Design
    </p>
            </VerticalTimelineElement>
          </VerticalTimeline>
        </div>
        <div>
        </div>
      </div>
    </div>
  );
}
